import styled from 'styled-components';
import Checkbox from 'pages/Todo/components/TodoList/Checkbox';
import useGetTodosQuery from 'pages/Todo/queries/useGetTodosQuery';
import Modal from 'pages/components/Modal';
import Input from 'pages/Auth/components/Input';
import { font } from 'styles/fonts';

export default function TodoList() {
  const { data } = useGetTodosQuery();

  return (
    <TodoListWrap>
      <AddTodoBtn>할 일 추가하기</AddTodoBtn>
      <Checkbox text="hello" />
      <Modal isOpen>
        <NewTodoModalContainer>
          <Title>새로운 할 일</Title>
          <Input
            title="제목"
            onChangeInput={() => {}}
            placeholder="새로운 할 일은 무엇인가요?"
          />
        </NewTodoModalContainer>
      </Modal>
    </TodoListWrap>
  );
}

const TodoListWrap = styled.div``;

const AddTodoBtn = styled.button`
  margin-bottom: 10px;
  padding: 10px;
  background-color: #c1a179;
  border-radius: 5px;
  color: white;
`;

const NewTodoModalContainer = styled.div`
  text-align: center;
  padding: 40px 10px;

  background-color: yellow;
`;

const Title = styled.h1`
  margin-bottom: 15px;
  ${font(24, 700, 30)}
  color: #C58940;
`;

const NewTodoInput = styled.input``;
